insert into TB_CFOP (ID, CFOP, DESCRICAO, APLICACAO) values('118','2101','Compra para industrialização','Classificam-se neste código as compras de mercadorias a serem utilizadas em processo de industrialização. Também serão classificadas neste código as entradas de mercadorias em estabelecimento industrial de cooperativa recebidas de seus cooperados ou de estabelecimento de outra cooperativa.');
