insert into TB_CFOP (ID, CFOP, DESCRICAO, APLICACAO) values('120','2111','Compra para industrialização de mercadoria recebida anteriormente em consignação industrial','Classificam-se neste código as compras efetivas de mercadorias a serem utilizadas em processo de industrialização, recebidas anteriormente a título de consignação industrial.');
