insert into TB_CFOP (ID, CFOP, DESCRICAO, APLICACAO) values('272','5117','Venda de mercadoria adquirida ou recebida de terceiros, originada de encomenda para entrega futura','Classificam-se neste código as vendas de mercadorias adquiridas ou recebidas de terceiros, que não tenham sido objeto de qualquer processo industrial no estabelecimento, quando da saída real da mercadoria, cujo faturamento tenha sido classificado no código 5.922 - Lançamento efetuado a título de simples faturamento decorrente de venda para entrega futura.');
