insert into TB_CFOP (ID, CFOP, DESCRICAO, APLICACAO) values('389','6101','Venda de produção do estabelecimento','Classificam-se neste código as vendas de produtos industrializados no estabelecimento. Também serão classificadas neste código as vendas de mercadorias por estabelecimento industrial de cooperativa destinadas a seus cooperados ou a estabelecimento de outra cooperativa.');
insert into TB_CFOP (ID, CFOP, DESCRICAO, APLICACAO) values('390','6102','Venda de mercadoria adquirida ou recebida de terceiros','Classificam-se neste código as vendas de mercadorias adquiridas ou recebidas de terceiros para industrialização ou comercialização, que não tenham sido objeto de qualquer processo industrial no estabelecimento. Também serão classificadas neste código as vendas de mercadorias por estabelecimento comercial de cooperativa destinadas a seus cooperados ou estabelecimento de outra cooperativa.');
insert into TB_CFOP (ID, CFOP, DESCRICAO, APLICACAO) values('391','6103','Venda de produção do estabelecimento, efetuada fora do estabelecimento','Classificam-se neste código as vendas efetuadas fora do estabelecimento, inclusive por meio de veículo, de produtos industrializados no estabelecimento.');
insert into TB_CFOP (ID, CFOP, DESCRICAO, APLICACAO) values('392','6104','Venda de mercadoria adquirida ou recebida de terceiros, efetuada fora do estabelecimento','Classificam-se neste código as vendas efetuadas fora do estabelecimento, inclusive por meio de veículo, de mercadorias adquiridas ou recebidas de terceiros para industrialização ou comercialização, que não tenham sido objeto de qualquer processo industrial no estabelecimento.');
insert into TB_CFOP (ID, CFOP, DESCRICAO, APLICACAO) values('393','6105','Venda de produção do estabelecimento que não deva por ele transitar','Classificam-se neste código as vendas de produtos industrializados no estabelecimento, armazenados em depósito fechado, armazém geral ou outro sem que haja retorno ao estabelecimento depositante.');
insert into TB_CFOP (ID, CFOP, DESCRICAO, APLICACAO) values('394','6106','Venda de mercadoria adquirida ou recebida de terceiros, que não deva por ele transitar','Classificam-se neste código as vendas de mercadorias adquiridas ou recebidas de terceiros para industrialização ou comercialização, armazenadas em depósito fechado, armazém geral ou outro, que não tenham sido objeto de qualquer processo industrial no estabelecimento sem que haja retorno ao estabelecimento depositante. Também serão classificadas neste código as vendas de mercadorias importadas, cuja saída ocorra do recinto alfandegado ou da repartição alfandegária onde se processou o desembaraço aduaneiro, com destino ao estabelecimento do comprador, sem transitar pelo estabelecimento do importador.');
insert into TB_CFOP (ID, CFOP, DESCRICAO, APLICACAO) values('395','6107','Venda de produção do estabelecimento, destinada a não contribuinte','Classificam-se neste código as vendas de produtos industrializados no estabelecimento, destinadas a não contribuintes. Quaisquer operações de venda destinadas a não contribuintes deverão ser classificadas neste código.');
insert into TB_CFOP (ID, CFOP, DESCRICAO, APLICACAO) values('396','6108','Venda de mercadoria adquirida ou recebida de terceiros, destinada a não contribuinte','Classificam-se neste código as vendas de mercadorias adquiridas ou recebidas de terceiros para industrialização ou comercialização, que não tenham sido objeto de qualquer processo industrial no estabelecimento, destinadas a não contribuintes. Quaisquer operações de venda destinadas a não contribuintes deverão ser classificadas neste código.');
insert into TB_CFOP (ID, CFOP, DESCRICAO, APLICACAO) values('397','6109','Venda de produção do estabelecimento, destinada à Zona Franca de Manaus ou Áreas de Livre Comércio','Classificam-se neste código as vendas de produtos industrializados pelo estabelecimento, destinados à Zona Franca de Manaus ou Áreas de Livre Comércio.');
insert into TB_CFOP (ID, CFOP, DESCRICAO, APLICACAO) values('398','6110','Venda de mercadoria adquirida ou recebida de terceiros, destinada à Zona Franca de Manaus ou Áreas de Livre Comércio','Classificam-se neste código as vendas de mercadorias adquiridas ou recebidas de terceiros, que não tenham sido objeto de qualquer processo industrial no estabelecimento, destinadas à Zona Franca de Manaus ou Áreas de Livre Comércio.');
