insert into TB_CFOP (ID, CFOP, DESCRICAO, APLICACAO) values('404','6116','Venda de produção do estabelecimento originada de encomenda para entrega futura','Classificam-se neste código as vendas de produtos industrializados pelo estabelecimento, quando da saída real do produto, cujo faturamento tenha sido classificado no código 6.922 - Lançamento efetuado a título de simples faturamento decorrente de venda para entrega futura.');
insert into TB_CFOP (ID, CFOP, DESCRICAO, APLICACAO) values('405','6117','Venda de mercadoria adquirida ou recebida de terceiros, originada de encomenda para entrega futura','Classificam-se neste código as vendas de mercadorias adquiridas ou recebidas de terceiros, que não tenham sido objeto de qualquer processo industrial no estabelecimento, quando da saída real da mercadoria, cujo faturamento tenha sido classificado no código 6.922 - Lançamento efetuado a título de simples faturamento decorrente de venda para entrega futura.');
