insert into TB_CFOP (ID, CFOP, DESCRICAO, APLICACAO) values('491','6910','Remessa em bonificação, doação ou brinde','Classificam-se neste código as remessas de mercadorias a título de bonificação, doação ou brinde.');
insert into TB_CFOP (ID, CFOP, DESCRICAO, APLICACAO) values('492','6911','Remessa de amostra grátis','Classificam-se neste código as remessas de mercadorias a título de amostra grátis.');
insert into TB_CFOP (ID, CFOP, DESCRICAO, APLICACAO) values('493','6912','Remessa de mercadoria ou bem para demonstração','Classificam-se neste código as remessas de mercadorias ou bens para demonstração.');
