insert into TB_CFOP (ID, CFOP, DESCRICAO, APLICACAO) values('495','6914','Remessa de mercadoria ou bem para exposição ou feira','Classificam-se neste código as remessas de mercadorias ou bens para exposição ou feira.');
insert into TB_CFOP (ID, CFOP, DESCRICAO, APLICACAO) values('496','6915','Remessa de mercadoria ou bem para conserto ou reparo','Classificam-se neste código as remessas de mercadorias ou bens para conserto ou reparo.');
insert into TB_CFOP (ID, CFOP, DESCRICAO, APLICACAO) values('497','6916','Retorno de mercadoria ou bem recebido para conserto ou reparo','Classificam-se neste código as remessas em devolução de mercadorias ou bens recebidos para conserto ou reparo.');
insert into TB_CFOP (ID, CFOP, DESCRICAO, APLICACAO) values('498','6917','Remessa de mercadoria em consignação mercantil ou industrial','Classificam-se neste código as remessas de mercadorias a título de consignação mercantil ou industrial.');
insert into TB_CFOP (ID, CFOP, DESCRICAO, APLICACAO) values('499','6918','Devolução de mercadoria recebida em consignação mercantil ou industrial','Classificam-se neste código as devoluções de mercadorias recebidas anteriormente a título de consignação mercantil ou industrial.');
insert into TB_CFOP (ID, CFOP, DESCRICAO, APLICACAO) values('500','6919','Devolução simbólica de mercadoria vendida ou utilizada em processo industrial, recebida anteriormente em consignação mercantil ou industrial','Classificam-se neste código as devoluções simbólicas de mercadorias vendidas ou utilizadas em processo industrial, que tenham sido recebidas anteriormente a título de consignação mercantil ou industrial.');
