insert into TB_CFOP (ID, CFOP, DESCRICAO, APLICACAO) values('502','6921','Devolução de vasilhame ou sacaria','Classificam-se neste código as saídas por devolução de vasilhame ou sacaria.');
insert into TB_CFOP (ID, CFOP, DESCRICAO, APLICACAO) values('503','6922','Lançamento efetuado a título de simples faturamento decorrente de venda para entrega futura','Classificam-se neste código os registros efetuados a título de simples faturamento decorrente de venda para entrega futura.');
insert into TB_CFOP (ID, CFOP, DESCRICAO, APLICACAO) values('504','6923','Remessa de mercadoria por conta e ordem de terceiros, em venda à ordem','Classificam-se neste código as saídas correspondentes à entrega de mercadorias por conta e ordem de terceiros, em vendas à ordem, cuja venda ao adquirente originário, foi classificada nos códigos 6.118 - Venda de produção do estabelecimento entregue ao destinatário por conta e ordem do adquirente originário, em venda à ordem ou 6.119 - Venda de mercadoria adquirida ou recebida de terceiros entregue ao destinatário por conta e ordem do adquirente originário, em venda à ordem.');
insert into TB_CFOP (ID, CFOP, DESCRICAO, APLICACAO) values('505','6924','Remessa para industrialização por conta e ordem do adquirente da mercadoria, quando esta não transitar pelo estabelecimento do adquirente','Classificam-se neste código as saídas de insumos com destino a estabelecimento industrializador, para serem industrializados por conta e ordem do adquirente, nas hipóteses em que os insumos não tenham transitado pelo estabelecimento do adquirente dos mesmos.');
insert into TB_CFOP (ID, CFOP, DESCRICAO, APLICACAO) values('506','6925','Retorno de mercadoria recebida para industrialização por conta e ordem do adquirente da mercadoria, quando aquela não transitar pelo estabelecimento do adquirente','Classificam-se neste código as remessas, pelo estabelecimento industrializador, dos insumos recebidos, por conta e ordem do adquirente, para industrialização e incorporados ao produto final, nas hipóteses em que os insumos não tenham transitado pelo estabelecimento do adquirente. O valor dos insumos nesta operação deverá ser igual ao valor dos insumos recebidos para industrialização.');
insert into TB_CFOP (ID, CFOP, DESCRICAO, APLICACAO) values('507','6929','Lançamento efetuado em decorrência de emissão de documento fiscal relativo a operação ou prestação também registrada em equipamento Emissor de Cupom Fiscal - ECF','Classificam-se neste código os registros relativos aos documentos fiscais emitidos em operações ou prestações que também tenham sido registradas em equipamento Emissor de Cupom Fiscal - ECF.');
insert into TB_CFOP (ID, CFOP, DESCRICAO, APLICACAO) values('508','6931','Lançamento efetuado em decorrência da responsabilidade de retenção do imposto por substituição tributária, atribuída ao remetente ou alienante da mercadoria, pelo serviço de transporte realizado por transportador autônomo ou por transportador não inscrito na unidade da Federação onde iniciado o serviço','Classificam-se neste código exclusivamente os lançamentos efetuados pelo remetente ou alienante da mercadoria quando lhe for atribuída a responsabilidade pelo recolhimento do imposto devido pelo serviço de transporte realizado por transportador autônomo ou por transportador não inscrito na unidade da Federação onde iniciado o serviço.');
insert into TB_CFOP (ID, CFOP, DESCRICAO, APLICACAO) values('509','6932','Prestação de serviço de transporte iniciada em unidade da Federação diversa daquela onde inscrito o prestador','Classificam-se neste código as prestações de serviço de transporte que tenham sido iniciadas em unidade da Federação diversa daquela onde o prestador está inscrito como contribuinte.');
insert into TB_CFOP (ID, CFOP, DESCRICAO, APLICACAO) values('510','6933','Prestação de serviço tributado pelo ISSQN (ajuste sinief 03/04)','Classificam-se neste código as prestações de serviços, de competência municipal, desde que informados em documentos autorizados pelo Estado');
insert into TB_CFOP (ID, CFOP, DESCRICAO, APLICACAO) values('511','6949','Outra saída de mercadoria ou prestação de serviço não especificado','Classificam-se neste código as outras saídas de mercadorias ou prestações de serviços que não tenham sido especificados nos códigos anteriores.');
insert into TB_CFOP (ID, CFOP, DESCRICAO, APLICACAO) values('512','7000','SAÍDAS OU PRESTAÇÕES DE SERVIÇOS PARA O EXTERIOR','Classificam-se, neste grupo, as operações ou prestações em que o destinatário esteja localizado em outro país');
insert into TB_CFOP (ID, CFOP, DESCRICAO, APLICACAO) values('513','7100','VENDAS DE PRODUÇÃO PRÓPRIA OU DE TERCEIROS','');
insert into TB_CFOP (ID, CFOP, DESCRICAO, APLICACAO) values('514','7101','Venda de produção do estabelecimento','Classificam-se neste código as vendas de produtos industrializados no estabelecimento. Também serão classificadas neste código as vendas de mercadorias por estabelecimento industrial de cooperativa.');
insert into TB_CFOP (ID, CFOP, DESCRICAO, APLICACAO) values('515','7102','Venda de mercadoria adquirida ou recebida de terceiros','Classificam-se neste código as vendas de mercadorias adquiridas ou recebidas de terceiros para industrialização ou comercialização, que não tenham sido objeto de qualquer processo industrial no estabelecimento. Também serão classificadas neste código as vendas de mercadorias por estabelecimento comercial de cooperativa.');
insert into TB_CFOP (ID, CFOP, DESCRICAO, APLICACAO) values('516','7105','Venda de produção do estabelecimento, que não deva por ele transitar','Classificam-se neste código as vendas de produtos industrializados no estabelecimento, armazenados em depósito fechado, armazém geral ou outro sem que haja retorno ao estabelecimento depositante.');
insert into TB_CFOP (ID, CFOP, DESCRICAO, APLICACAO) values('517','7106','Venda de mercadoria adquirida ou recebida de terceiros, que não deva por ele transitar','Classificam-se neste código as vendas de mercadorias adquiridas ou recebidas de terceiros para industrialização ou comercialização, armazenadas em depósito fechado, armazém geral ou outro, que não tenham sido objeto de qualquer processo industrial no estabelecimento sem que haja retorno ao estabelecimento depositante. Também serão classificadas neste código as vendas de mercadorias importadas, cuja saída ocorra do recinto alfandegado ou da repartição alfandegária onde se processou o desembaraço aduaneiro, com destino ao estabelecimento do comprador, sem transitar pelo estabelecimento do importador.');
insert into TB_CFOP (ID, CFOP, DESCRICAO, APLICACAO) values('518','7127','Venda de produção do estabelecimento sob o regime de drawback ','Classificam-se neste código as vendas de produtos industrializados no estabelecimento sob o regime de drawback , cujas compras foram classificadas no código 3.127 - Compra para industrialização sob o regime de drawback.');
insert into TB_CFOP (ID, CFOP, DESCRICAO, APLICACAO) values('519','7200','DEVOLUÇÕES DE COMPRAS PARA INDUSTRIALIZAÇÃO, COMERCIALIZAÇÃO OU ANULAÇÕES DE VALORES','');
insert into TB_CFOP (ID, CFOP, DESCRICAO, APLICACAO) values('520','7201','Devolução de compra para industrialização','Classificam-se neste código as devoluções de mercadorias adquiridas para serem utilizadas em processo de industrialização, cujas entradas tenham sido classificadas como Compra para industrialização.');
insert into TB_CFOP (ID, CFOP, DESCRICAO, APLICACAO) values('521','7202','Devolução de compra para comercialização','Classificam-se neste código as devoluções de mercadorias adquiridas para serem comercializadas, cujas entradas tenham sido classificadas como Compra para comercialização.');
insert into TB_CFOP (ID, CFOP, DESCRICAO, APLICACAO) values('522','7205','Anulação de valor relativo à aquisição de serviço de comunicação','Classificam-se neste código as anulações correspondentes a valores faturados indevidamente, decorrentes das aquisições de serviços de comunicação.');
insert into TB_CFOP (ID, CFOP, DESCRICAO, APLICACAO) values('523','7206','Anulação de valor relativo a aquisição de serviço de transporte','Classificam-se neste código as anulações correspondentes a valores faturados indevidamente, decorrentes das aquisições de serviços de transporte.');
insert into TB_CFOP (ID, CFOP, DESCRICAO, APLICACAO) values('524','7207','Anulação de valor relativo à compra de energia elétrica','Classificam-se neste código as anulações correspondentes a valores faturados indevidamente, decorrentes da compra de energia elétrica.');
insert into TB_CFOP (ID, CFOP, DESCRICAO, APLICACAO) values('525','7210','Devolução de compra para utilização na prestação de serviço','Classificam-se neste código as devoluções de mercadorias adquiridas para utilização na prestação de serviços, cujas entradas tenham sido classificadas no código 3.126 - Compra para utilização na prestação de serviço.');
insert into TB_CFOP (ID, CFOP, DESCRICAO, APLICACAO) values('526','7211','Devolução de compras para industrialização sob o regime de drawback ','Classificam-se neste código as devoluções de mercadorias adquiridas para serem utilizadas em processo de industrialização sob o regime de drawback e não utilizadas no referido processo, cujas entradas tenham sido classificadas no código 3.127 - Compra para industrialização sob o regime de drawback.');
