insert into TB_CFOP (ID, CFOP, DESCRICAO, APLICACAO) values('534','7501','Exportação de mercadorias recebidas com fim específico de exportação','Classificam-se neste código as exportações das mercadorias recebidas anteriormente com finalidade específica de exportação, cujas entradas tenham sido classificadas nos códigos 1.501 - Entrada de mercadoria recebida com fim específico de exportação ou 2.501 - Entrada de mercadoria recebida com fim específico de exportação.');
