insert into TB_PLANO_CONTA_REF_SPED(COD_CTA_REF, DESCRICAO, ORIENTACOES, INICIO_VALIDADE, FIM_VALIDADE, TIPO) values ('1.07.01.07.00','(-) Deságios e Provisão para Perdas Prováveis em Investimentos','Contas que registram: a) o deságio por diferença de valor de mercado dos bens, por valor de rentabilidade futura e por fundo de comércio, intangíveis, ou outras razões econômicas; b) o valor correspondente à provisão para perdas em investimentos registrados pelo método de custo e à provisão para perdas em investimentos avaliados pelo método da equivalência patrimonial, sendo que, neste último caso, deve ser informado somente o valor das perdas efetivas ou potenciais já previstas, mas não reconhecidas contabilmente pela coligada ou controlada.',null ,null,'A');
