insert into TB_PLANO_CONTA_REF_SPED(COD_CTA_REF, DESCRICAO, ORIENTACOES, INICIO_VALIDADE, FIM_VALIDADE, TIPO) values ('3.01.01.01.01.02.00','Receita da Venda no Mercado Interno de Produtos de Fabricação Própria','Contas que registram a receita auferida no mercado interno correspondente à venda de produtos de fabricação própria e as receitas auferidas na industrialização por encomenda ou por conta e ordem de terceiros. (Não se incluem o valor correspondente ao Imposto sobre Produtos Industrializados (IPI) cobrado destacadamente do comprador ou contratante, uma vez que o vendedor é mero depositário e este imposto não integra o preço de venda da mercadoria, e, também, o valor correspondente ao ICMS cobrado na condição de substituto.)',null ,null,'A');
insert into TB_PLANO_CONTA_REF_SPED(COD_CTA_REF, DESCRICAO, ORIENTACOES, INICIO_VALIDADE, FIM_VALIDADE, TIPO) values ('3.01.01.01.01.03.00','Receita da Revenda de Mercadorias no Mercado Interno','Contas que registram receita auferida no mercado interno, correspondente à revenda de mercadorias e o resultado auferido nas operações de conta alheia.',null ,null,'A');
