insert into TB_PLANO_CONTA_REF_SPED(COD_CTA_REF, DESCRICAO, ORIENTACOES, INICIO_VALIDADE, FIM_VALIDADE, TIPO) values ('3.01.01.01.03.01.00','(-) Vendas Canceladas, Devoluções e Descontos Incondicionais','Contas representativas das vendas canceladas, a devoluções de vendas e a descontos incondicionais concedidos sobre  receitas constantes das contas integrantes do grupo RECEITA BRUTA',null ,null,'A');
insert into TB_PLANO_CONTA_REF_SPED(COD_CTA_REF, DESCRICAO, ORIENTACOES, INICIO_VALIDADE, FIM_VALIDADE, TIPO) values ('3.01.01.01.03.02.00','(-) ICMS','Contas que registram o total do Imposto Sobre Operações Relativas à Circulação de Mercadorias e Sobre Prestação de Serviços de Transporte Interestadual e Intermunicipal e de Comunicação (ICMS) calculado sobre as receitas das vendas e de serviços constantes das contas integrantes do grupo RECEITA BRUTA. Informar o resultado da aplicação das alíquotas sobre as respectivas receitas, e não o montante recolhido, durante o período de apuração, pela pessoa jurídica.O valor referente ao ICMS pago como substituto não deve ser incluído nesta conta.',null ,null,'A');
insert into TB_PLANO_CONTA_REF_SPED(COD_CTA_REF, DESCRICAO, ORIENTACOES, INICIO_VALIDADE, FIM_VALIDADE, TIPO) values ('3.01.01.01.03.03.00','(-) Cofins','vigente à época da ocorrência dos fatos geradores, incidente sobre as receitas das contas integrantes do grupo RECEITA BRUTA. O valor informado deve ser apurado de forma centralizada pelo estabelecimento matriz, quando a pessoa jurídica possuir mais de um estabelecimento (Lei no 9.779, de 1999, art. 15, III). Não incluir a Cofins incidente sobre as demais receitas operacionais, que deverá ser informada em conta distinta.',null ,null,'A');
insert into TB_PLANO_CONTA_REF_SPED(COD_CTA_REF, DESCRICAO, ORIENTACOES, INICIO_VALIDADE, FIM_VALIDADE, TIPO) values ('3.01.01.01.03.04.00','(-) PIS/Pasep','Contas que registram as contribuições para o PIS/Pasep apurado sobre a receita de vendas em consonância com a legislação vigente à época da ocorrência dos fatos geradores, incidente sobre as receitas das contas integrantes do grupo RECEITA BRUTA. O valor informado deve ser apurado de forma centralizada pelo estabelecimento matriz, quando a pessoa jurídica possuir mais de um estabelecimento (Lei no 9.779, de 1999, art. 15, III). Não incluir o PIS/Pasep incidente sobre as demais receitas operacionais, que deverá ser informada em conta distinta.',null ,null,'A');
insert into TB_PLANO_CONTA_REF_SPED(COD_CTA_REF, DESCRICAO, ORIENTACOES, INICIO_VALIDADE, FIM_VALIDADE, TIPO) values ('3.01.01.01.03.05.00','(-) ISS','Contas que registram o Imposto sobre Serviço de qualquer Natureza (ISS) relativo às receitas de serviços,conforme legislação específica.',null ,null,'A');
insert into TB_PLANO_CONTA_REF_SPED(COD_CTA_REF, DESCRICAO, ORIENTACOES, INICIO_VALIDADE, FIM_VALIDADE, TIPO) values ('3.01.01.01.03.06.00','(-) Demais Impostos e Contribuições Incidentes sobre Vendas e Serviços','Contas que registrem os demais impostos e contribuições incidentes sobre as receitas das vendas de que tratam as contas integrantes do grupo RECEITA BRUTA, que guardem proporcionalidade com o preço e sejam considerados redutores das receitas de vendas.',null ,null,'A');
