insert into TB_PLANO_CONTA_REF_SPED(COD_CTA_REF, DESCRICAO, ORIENTACOES, INICIO_VALIDADE, FIM_VALIDADE, TIPO) values ('3.05.03.01.01.01.00','(-) Participações de Empregados','Contas que registram as participações atribuídas a empregados segundo disposição legal, estatutária, contratual ou por deliberação da assembléia de acionistas ou sócios.',null ,null,'A');
insert into TB_PLANO_CONTA_REF_SPED(COD_CTA_REF, DESCRICAO, ORIENTACOES, INICIO_VALIDADE, FIM_VALIDADE, TIPO) values ('3.05.03.01.01.02.00','(-) Contribuições para Assistência ou Previdência de Empregados','Contas que registram as contribuições para instituições ou fundos de assistência ou previdência de empregados, baseadas nos lucros. Não indicar, nesta conta, aquelas contribuições já deduzidas como custo ou despesa operacional.',null ,null,'A');
