insert into TB_PLANO_CONTA_REF_SPED(COD_CTA_REF, DESCRICAO, ORIENTACOES, INICIO_VALIDADE, FIM_VALIDADE, TIPO) values ('3.05.03.01.03.02.00','(-) Participações de Debêntures','Contas que representam as participações nos lucros da companhia atribuídas a debêntures de sua emissão',null ,null,'A');
